import './Portfolio.css';

function Portfolio() {
  return (
    <main className="Portfolio">
          <div className="port-title">
            <h1>Portfolio</h1>
            <h2>Projetos mais recentes em que eu trabalhei</h2>
          </div>
          <div className="port-sub title">
            
          </div>
    </main>
  );
}

export default Portfolio;
